import React, { Component } from 'react'
import PropTypes from 'prop-types';

export class ToDoItems extends Component {
    render() {
        return (
            <div>
                <h1>{this.props.todolist.title}</h1>
            </div>
        )
    }
}
// PropTypes
ToDoItems.propTypes ={
    todolist : PropTypes.array.isRequired
}
export default ToDoItems;
